import React, { memo } from "react";
import { useSelector } from "react-redux";
import icons from "../ultis/icon";
const Chart = () => {
    const {PiPlayCircleThin} = icons
  const { chart } = useSelector((state) => state.app);
  console.log(chart);
  return (
    <div className="flex p-9 relative  h-[200px] ">
      <div className="absolute top-4 bottom-8 left-9 right-9 bg-chart-bg rounded-md"></div>
      <div className="absolute top-4 bottom-8 left-9 right-9 bg-chart p-3 rounded-md flex flex-col">
        <div className="flex items-center">
            <h3 className="bg-gradient-to-r text-2xl font-bold bg-clip-text text-transparent from-[#ff9357] from-10% to-[#9100ff]">{chart?.title}</h3>
            <span><PiPlayCircleThin size={18} /></span>
        </div>
        <div className="flex ">
            <div>
                chart left
            </div>
            <div>
                chart right
            </div>
        </div>
      </div>
    </div>
  );
};

export default memo(Chart);
